import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from 'react-bootstrap/Card';

const info = [
    {
        titel: "Klubbmästare",
        namn: "Oliver Jensen",
        img: null
    },
    {
        titel: "Vice Klubbmästare",
        namn: "Johan Widmark",
        img: null
    },
    {
        titel: "Pubmästare",
        namn: "Adam Henriksson",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    }
];



const KM = React.memo(() => {
    let arr;
    info.forEach((person, i) => {
        arr[i%3].push(person)
    });

    const content = arr.map((list, i) => {
        const innerContent = arr.map((innerList, i) => {
            return (
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Klubbmästare</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>Oliver Jensen</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            )
        });

        return (
            <Row>
                { innerContent }
            </Row>
        )

    });

    return(
        <Container className="wide">

            <Row>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Klubbmästare</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>Oliver Jensen</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Vice Klubbmästare</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>Johan Widmark</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Pubmästare</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>Adam Henriksson</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
            <Row>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Marsalk</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title></Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Marsalk</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title></Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
                <Col sm>
                    <Card bg="dark">
                        <Card.Header>Marsalk</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title></Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
});


export default KM;
